script: |
  super -f text -I q2096.spq | sort > q2096.out

inputs:
  - name: q2096.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + - 93 / + 21 - + col2 * - + 50 NOT IN ( 17 + 5 + + col1 * - col0, - col0 * - 42 * + col1, - 84 );
  - name: tab2

outputs:
  - name: q2096.out
    data: |
